import React from "react";

const Body = () => {
    return (
        <div id="main">
            <div className="inner">
                <h1>Eleanor Roosevelt</h1>
                <span className="image main"><img src="images/pic13.jpg" alt="" /></span>
                <p>Anna Eleanor Roosevelt was born on October 11, 1884, in New York City. Her father, Elliott Roosevelt (1860-1894)
                     was the younger brother of Theodore Roosevelt, and her mother, Anna Hall (1863-1892), was from a wealthy New York family.
            </p>
            </div>
        </div>
    );
}

export default Body;
